    false,nt"url": null,nt"notes": "This annual narrative report for Trempealeau
    National Wildlife Refuge summarizes Refuge activities during the 1992 calendar year.
     The report begins with a summary of the yearu2019s highlights and climatic conditions.
     Land acquisition is also covered.  The report includes a planning section which
    discusses the master plan, public participation, compliance with environmental and
    cultural resource mandates, research, and investigations.  Refuge administration
    is outlined; information about personnel, manpower programs, volunteer programs,
    funding, and safety is given.  Habitat management is also covered.  Subjects include
    wetlands, forests, grasslands, haying, pest control, and Farmers Home Administration
    Easements.  The wildlife section of the report discusses wildlife diversity, endangered
    species, threatened species, waterfowl, marsh birds, water birds, shorebirds, raptors,
    game mammals, fisheries resources, and marking/banding.  The public uses of the
    Refuge described in this report include outdoor classrooms, interpretive exhibits,
    hunting, fishing, trapping, wildlife observation, camping, and law enforcement.
     The equipment and facilities section of the report provides information about
    new construction, rehabilitation, equipment utilization/replacement, and computer
    systems.  Cooperative programs are provided at the end; Refuge brochures are attached.",nt"license_title":
